// Home.js
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { handleError, handleSuccess } from '../utils/ReactToastify';
import { ToastContainer } from 'react-toastify';
import '../utils/ReactToastifyCustom.css';
import '../utils/loading.css';
import jwt from 'jsonwebtoken'; // Add this if using jwt.decode

function Home() {
    const [loggedInUser, setLoggedInUser] = useState('');
    const [users, setUsers] = useState([]);
    const [loading, setLoading] = useState(false);
    const [fadeOut, setFadeOut] = useState(false);
    const navigate = useNavigate();

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (token) {
            try {
                const decodedToken = jwt.decode(token);
                setLoggedInUser(decodedToken.username); // Assuming username is in the token
            } catch (error) {
                handleError('Invalid token');
                navigate('/login');
            }
        } else {
            navigate('/login');
        }
    }, [navigate]);

    const handleLogout = () => {
        setLoading(true);
        setFadeOut(false);

        setTimeout(() => {
            setFadeOut(true);
            setTimeout(() => {
                localStorage.removeItem('token');
                localStorage.removeItem('loggedInUser');
                handleSuccess('User logged out successfully');
                navigate('/login');
            }, 250);
        }, 1000);
    };

    const fetchUsers = async () => {
        setLoading(true);
        try {
            const token = localStorage.getItem('token');
            if (!token) {
                throw new Error('No token found');
            }
            const url = "http://localhost:8080/Users";
            const headers = {
                'Authorization': `Bearer ${token}`
            };
            const response = await fetch(url, { headers });
            
            if (response.status === 403) {
                handleError('Forbidden: Access denied');
                navigate('/login');
                return;
            }

            const result = await response.json();
            if (response.ok) {
                setUsers(result);
            } else {
                handleError(result.message || 'Failed to fetch users');
            }
        } catch (err) {
            handleError(err.message || 'An error occurred');
        } finally {
            setLoading(false);
        }
    };

    useEffect(() => {
        fetchUsers();
    }, []);

    return (
        <div className='container'>
            <h1>Welcome {loggedInUser}</h1>
            <div>
                {users.length > 0 ? (
                    users.map((user, index) => (
                        <ul key={index}>
                            <li>Name: {user.name}</li>
                            <li>Email: {user.email}</li>
                            <li>Created At: {new Date(user.createdAt).toLocaleDateString()}</li>
                            {/* Add any other fields you want to display */}
                        </ul>
                    ))
                ) : (
                    <p>No users found</p>
                )}
            </div>

            <button onClick={handleLogout}>Logout</button>

            <ToastContainer />
            
            {loading && (
                <div className={`loading-overlay ${fadeOut ? 'hidden' : ''}`}>
                    <img src='/apple-loading.gif' alt='Loading...' className='loading-spinner' />
                </div>
            )}
        </div>
    );
}

export default Home;
